    /// Check if the provider's API key is available in environment.
    pub fn is_available(&self) -> bool {
        match self {
            Provider::Bedrock => {
                std::env::var("AWS_ACCESS_KEY_ID").is_ok() || std::env::var("AWS_PROFILE").is_ok()
            }
            // Local providers - always available
            Provider::Vllm
            | Provider::Local
            | Provider::Custom
            | Provider::Ollama
            | Provider::GPT4All
            | Provider::LMStudio
            | Provider::Llamafile
            | Provider::Xinference
            | Provider::LocalAI
            | Provider::Jan
            | Provider::Petals
            | Provider::Tgi => true,
            _ => self
                .api_key_env_var()
                .map(|v| std::env::var(v).is_ok())
                .unwrap_or(true),
        }
    }

