// CAPABILITIES
// ============================================================================

/// Model capabilities.
#[derive(Debug, Clone, Copy, Default)]
pub struct ModelCapabilities {
    pub max_context: u32,
    pub max_output: u32,
    pub vision: bool,
    pub tools: bool,
    pub streaming: bool,
    pub json_mode: bool,
    /// Full structured output with JSON schema enforcement.
    /// True when the provider supports strict JSON schema validation,
    /// not just simple JSON mode.
    pub structured_output: bool,
    pub thinking: bool,
    pub caching: bool,
}

impl ModelCapabilities {
    /// Create a new model capabilities with maximum context and output lengths.
    ///
    /// By default, enables tools and streaming support. Other capabilities
    /// (vision, JSON mode, structured output, thinking, caching) are disabled.
    ///
    /// # Arguments
    ///
    /// * `max_context` - Maximum input context window size in tokens
    /// * `max_output` - Maximum output generation size in tokens
    pub fn new(max_context: u32, max_output: u32) -> Self {
        Self {
            max_context,
            max_output,
            tools: true,
            streaming: true,
            ..Default::default()
        }
    }

    /// Parse capability flags: V=vision, T=tools, J=json, S=structured output, K=thinking, C=cache
    pub fn from_flags(max_context: u32, max_output: u32, flags: &str) -> Self {
        Self {
            max_context,
            max_output,
            vision: flags.contains('V'),
            tools: flags.contains('T'),
            streaming: true,
            json_mode: flags.contains('J'),
            structured_output: flags.contains('S'),
            thinking: flags.contains('K'),
            caching: flags.contains('C'),
        }
    }
}

