// BENCHMARKS
// ============================================================================

/// Benchmark scores (0-100 scale, higher is better).
#[derive(Debug, Clone, Copy, Default)]
pub struct ModelBenchmarks {
    /// MMLU - General knowledge
    pub mmlu: Option<f32>,
    /// HumanEval - Code generation
    pub humaneval: Option<f32>,
    /// MATH - Mathematical reasoning
    pub math: Option<f32>,
    /// GPQA Diamond - Graduate-level science
    pub gpqa: Option<f32>,
    /// SWE-bench - Software engineering
    pub swe_bench: Option<f32>,
    /// IFEval - Instruction following
    pub ifeval: Option<f32>,
    /// MMMU - Multimodal understanding
    pub mmmu: Option<f32>,
    /// MGSM - Multilingual math
    pub mgsm: Option<f32>,
    /// Time to first token (ms)
    pub ttft_ms: Option<u32>,
    /// Tokens per second
    pub tokens_per_sec: Option<u32>,
}

impl ModelBenchmarks {
    /// Calculate weighted quality score (0-100).
    #[allow(clippy::type_complexity)]
    pub fn quality_score(&self) -> f32 {
        const WEIGHTS: [(fn(&ModelBenchmarks) -> Option<f32>, f32); 8] = [
            (|b| b.mmlu, 1.5),
            (|b| b.humaneval, 2.0),
            (|b| b.math, 1.5),
            (|b| b.gpqa, 1.0),
            (|b| b.swe_bench, 2.5),
            (|b| b.ifeval, 1.0),
            (|b| b.mmmu, 1.5),
            (|b| b.mgsm, 1.0),
        ];

        let mut sum = 0.0f32;
        let mut weights = 0.0f32;

        for (getter, weight) in WEIGHTS {
            if let Some(s) = getter(self) {
                sum += s * weight;
                weights += weight;
            }
        }

        if weights > 0.0 {
            sum / weights
        } else {
            0.0
        }
    }

    /// Check if this model has any benchmark scores available.
    ///
    /// Returns true if at least one of the major benchmarks (MMLU, HumanEval, or MATH)
    /// has been measured for this model.
    pub fn has_benchmarks(&self) -> bool {
        self.mmlu.is_some() || self.humaneval.is_some() || self.math.is_some()
    }
}

